import axios from 'axios';
import { MoviesPerActorResponse, ActorsWithMultipleCharactersResponse, CharactersWithMultipleActorsResponse } from '../../../shared/types'
const API_URL = 'http://localhost:5000/api/characters';  // TODO Replace with env variable

export const fetchCharactersWithMultipleActors = async (): Promise<CharactersWithMultipleActorsResponse> => {
  const response = await axios.get(`${API_URL}/characters-with-multiple-actors`);
  return response.data;
};
